import React from "react";
import "./about.styles.css"

function About(){
    return(
        <div className="about">

            <h2>About</h2>
            <p>I am currently working as a Junior Software Engineer at Edenred Greece.Meanwhile I am doing my Msc on Modern Wireless Communications at University of Peloponnese. Moreover I am also part-time working as an Informatics Professor.  </p>
        </div>

    )
}


export default About;
